import axios from "axios";
import { ACCESS_TOKEN_USER } from "../types";

export const getUsers = (data) => {
  return async (dispatch) => {
    try {
      const req = await axios.post("/checkusers", data);
      dispatch({
        type: ACCESS_TOKEN_USER,
        payload: { token: req.data },
      });
      return req;
    } catch (error) {
      console.log(error);
    }
  };
};
